from time import sleepfrom restapi.seleniumautomation.comman_setup import get_browser, loginsample_data = {    "user": "aahoSupplier786",    "route": "ChennaiToGoa",    "pan": "CBPPK6008p",    "contact_person_name": "Contact_Mr.X",    "email": "xyz@example.com",    "phone": "5678956709",    "alternate_number": "6789678901",    "remarks": "expecting the delivery soon.........."}def create_broker(data):    browser = get_browser()    login(browser)    sleep(5)    #finding registration tab    registrationTab = browser.find_element_by_css_selector("i[class='fa fa-registered']")    sleep(2)    #click registration tab    registrationTab.click()    sleep(3)    #find supplier tab and click    supplierPageElem = browser.find_element_by_css_selector("a[data-url='/page/register-supplier-page/']")    browser.execute_script("arguments[0].scrollIntoView();", supplierPageElem)    sleep(5)    supplierPageElem.click()    sleep(5)    # finding fields for creating supplier    supplierName = browser.find_element_by_css_selector("input[name='user']")    supplierRoute = browser.find_element_by_css_selector("input[name='route']")    panNumber = browser.find_element_by_css_selector("input[name='pan']")    contactPersonName = browser.find_element_by_css_selector("input[name='contact_person_name']")    email = browser.find_element_by_css_selector("input[name='email']")    contactPersonNumber = browser.find_element_by_css_selector("input[name='phone']")    altNumber = browser.find_element_by_css_selector("input[name='alternate_number']")    remarks = browser.find_element_by_css_selector("textarea[name='remarks']")    distState = browser.find_element_by_css_selector("input[placeholder='Select State']")    city = browser.find_element_by_css_selector("span[id='select2-city-container']")    aahoPoc = browser.find_element_by_css_selector("span[id='select2-aaho_poc-container']")    aahoOffice = browser.find_element_by_css_selector("span[id='select2-aaho_office-container']")    registerSupplier = browser.find_element_by_css_selector("button[id='btn-register-supplier']")    #filling supplier details    if "user" in data:        supplierName.send_keys(data["user"])        sleep(2)    if "route" in data:        supplierRoute.send_keys(data["route"])        sleep(2)    if "pan" in data:        panNumber.send_keys(data["pan"])        sleep(2)    if "contact_person_name" in data:        contactPersonName.send_keys(data["contact_person_name"])        sleep(2)    if "email" in data:        email.send_keys(data["email"])        sleep(2)    if "phone" in data:        contactPersonNumber.send_keys(data["phone"])        sleep(2)    if "alternate_number" in data:        altNumber.send_keys(data["alternate_number"])        sleep(2)    if "remarks" in data:        remarks.send_keys(data["remarks"])        sleep(2)    distState.click()    sleep(2)    chooseState = browser.find_element_by_css_selector("ul[id='select2-states-results'] > li")    chooseState.click()    sleep(2)    city.click()    sleep(2)    chooseCity = browser.find_element_by_css_selector("ul[id='select2-city-results'] > li")    chooseCity.click()    sleep(2)    aahoPoc.click()    sleep(2)    choosePoc = browser.find_element_by_css_selector("ul[id='select2-aaho_poc-results'] > li")    choosePoc.click()    sleep(2)    aahoOffice.click()    sleep(2)    chooseOffice = browser.find_element_by_css_selector("ul[id='select2-aaho_office-results'] > li")    chooseOffice.click()    sleep(2)    #click register_supplier button    registerSupplier.click()    sleep(10)    browser.quit()